/* harmony default export */ __webpack_exports__["default"] = ("<!-- slider-area -->\n<section id=\"sub-header\" class=\"sub-header\" role=\"banner\"\n  [style.backgroundImage]=\"'url(../../assets/img/bg/map-bg.png)'\">\n  <div>\n    <h3 class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">Website Policy</h3>\n  </div>\n</section>\n<!-- slider-area-end -->\n\n<!-- About -->\n<section class=\"pt-40 pb-40\">\n  <div class=\"container\">\n\n    <div class=\"row flex-column-reverse flex-md-row\">\n      <div class=\"col-sm-8 mt-3\">\n         <h4 class=\"wow fadeInUp\" data-wow-delay=\"0.2s\" id=\"introduction\">INTRODUCTION</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>GoQuo (M) Sdn. Bhd. (we, us, our) complies with the Singapore Personal Data Protection Act 2012 (Act) and\n            the\n            General Data Protection Regulation of the European Union (GDPR), when dealing with personal information.</p>\n          <p>Personal information is information about an identifiable individual (a natural person), and includes\n            personal data, personally identifiable information and equivalent information under applicable privacy and\n            data protection laws.</p>\n          <p> This policy does not limit or exclude any of your rights under the Act or the GDPR. For further\n            information\n            on the Act, see https://www.pdpc.gov.sg/Legislation-and-Guidelines/Personal-Data-Protection-Act-Overview.\n            For\n            further information on the GDPR, see https://ec.europa.eu/info/law/law-topic/data-protection_en.</p>\n          <p>This policy was drafted with brevity and clarity in mind. It does not provide exhaustive detail of all\n            aspects of our collection and use of personal information. We are happy to provide any additional\n            information\n            or explanation needed. Any request for further information should be sent to <a class=\"theme-color\"\n              href=\"mailto: aaron@goquo.com\">aaron@goquo.com.</a></p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"change-policy\">CHANGES TO THIS POLICY</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>We may change this policy by uploading a revised policy onto our website. The change will apply from the\n            date\n            that we upload the revised policy. </p>\n          <p> <strong>This policy was last updated on Friday, 5 July 2019.</strong></p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"pp-apply\">WHEN DOES THIS PRIVACY POLICY APPLY</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>This privacy policy applies to personal information we collect from visitors to our website, our customers\n            and other persons with whom we deal directly. In addition, users of our SaaS service may collect personal\n            information from individuals (e.g. their employees and customers) and upload, store or process that\n            information to or in that service (User Data). </p>\n          <p> We require our customers to obtain the necessary consents from individuals to provide User Data to us and\n            permit us to use it as set out in this privacy policy. If you have any concern about our collection and use\n            of\n            personal information about you contained in User Data, please contact us at <a class=\"theme-color\"\n              href=\"mailto: aaron@goquo.com\">aaron@goquo.com.</a></p>\n          <p>For the purposes of the GDPR, our customers are the data controller when storing or otherwise processing\n            User\n            Data that we hold solely for the purpose of providing our SaaS service and we are the data processor. We are\n            the data controller when storing or otherwise processing User Data that we use for our own purposes.</p>\n          <p>We only process User Data as authorised by our customers in our Travlytix SaaS terms of use (available at\n            Friday, 5 July 2019) and/or other agreements with our customers that govern the processing of User Data (as\n            applicable).\n            Unless required otherwise under applicable law, if we receive any request or enquiry relating to User Data\n            that we hold solely for the purpose of providing our SaaS service, we will forward this request to our\n            relevant customer. If we receive any requests or enquiries relating to User Data that we use for our own\n            purposes, we will deal with these requests or enquiries as set out in this privacy policy.</p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"children\">CHILDREN</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>We do not intend to collect personal information from or about children aged under 16. If you have reason\n            to\n            believe that we have collected personal information from or about a child under the age of 16, please\n            contact\n            us at aaron@goquo.com.</p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"personal-info-col\">WHAT PERSONAL INFORMATION DO WE COLLECT</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p><strong>Directly from you</strong></p>\n          <p>We collect the following information directly from you. </p>\n          <p>When you fill in a contact or enquiry form on our website, call us, meet us in person or otherwise contact\n            us, we collect your name and email address and any other information you choose to provide to us.</p>\n          <p>Some of the personal information that we collect directly from you may be mandatory and some may be\n            optional. We will let you know which of these applies at the time we collect the relevant personal\n            information.\n            While you do not have to provide us with some of the information that we may request, this might mean that\n            our\n            products and services may not perform as well as they should, or that we may not be able to provide some\n            parts\n            of the website or all of our products or services to you. If you require further information about the\n            consequences of not providing us with any information, please contact us at <a class=\"theme-color\"\n              href=\"mailto: aaron@goquo.com\">aaron@goquo.com.</a></p>\n          <p><strong>Automatically when you use our website</strong></p>\n          <p> When you access and use our website or related services we may automatically collect information about\n            your\n            device and usage of our website, products and services, including your IP address/operating system/browser\n            type/time spent on certain pages of the website/pages visited/links clicked/language preferences.</p>\n          <p>Some of this data is collected through third party tools and/or the use of cookies, web beacons and similar\n            storage technologies. Please refer to our cookie policy below for further information, including information\n            on how you can disable these technologies.</p>\n          <p><strong>From third party sources</strong></p>\n          <p>Where possible, we collect personal information from you directly. However, sometimes we may collect:</p>\n          <div class=\"s-features__list list-sm mb-30\">\n            <ul class=\"mt-4\">\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>personal information from third parties where you have authorised this. This may include accessing\n                  certain personal information from third party social media or other authentication services (e.g.\n                  Facebook, Google or LinkedIn) if you login to your account with us using these services or otherwise\n                  provide us access to information from these sources. The third party provider that we use will be\n                  displayed and you can visit its privacy policy for further details on how it deals with personal\n                  information</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>personal information about you from our trusted advertising partners which may include demographic\n                  information, browsing history, location and online behavioural or profile information</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>personal information that is publicly available e.g. through LinkedIn profiles or public directories\n                </p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>personal information included in User Data.</p>\n              </li>\n            </ul>\n          </div>\n          <p>We may combine the personal information about you that we receive from third parties with the personal\n            information we collect from you directly or with device and usage data we collect automatically when you\n            visit\n            our website.</p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"personal-info\">HOW WE USE YOUR PERSONAL INFORMATION</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>We may use your personal information to:</p>\n          <div class=\"s-features__list list-sm mb-30\">\n            <ul class=\"mt-4\">\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>verify your identity</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>provide our website, products and services to you</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>market our products and services to you, including contacting you electronically (e.g. by text or\n                  email\n                  for this purpose)</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>improve our website, products and services</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>publish things on our website (e.g. comments on message boards or chat rooms)</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>run promotions (e.g. referral and loyalty programmes, surveys and contests)</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>undertake credit checks of you (if necessary)</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>bill you and collect money that you owe us, including authorising and processing credit card\n                  transactions</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>respond to communications from you, including enquiries and complaints</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>conduct research and statistical analysis (on an anonymised basis)</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>tailor content or advertisements on our website to you</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>protect and/or enforce our legal rights and interests, including defending any claim</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>respond to lawful requests by public authorities, including to comply with law enforcement\n                  requirements, or</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>for any other purpose authorised by you or applicable law.</p>\n              </li>\n            </ul>\n          </div>\n          <p>We may transfer your information in the case of a sale, merger, consolidation, liquidation, reorganisation\n            or\n            acquisition.</p>\n          <p>You can stop receiving our marketing emails by following the unsubscribe instructions included in those\n            emails.</p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"dis-personal-info\">DISCLOSING YOUR PERSONAL INFORMATION</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>We may disclose your personal information to:</p>\n          <div class=\"s-features__list list-sm mb-30\">\n            <ul class=\"mt-4\">\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>another company within our group</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>any business that supports our website, products and services, including any person that hosts or\n                  maintains any underlying IT system or data centre that we use to provide our website, products or\n                  services or that we use to process payments</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>third parties (for anonymised statistical information)</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>professional advisers e.g. accountants, lawyers or auditors</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>a person who can require us to supply your personal information (e.g. a law enforcement agency or\n                  regulatory authority)</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>any other person with your consent </p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>any other company in the case of a sale, merger, consolidation, liquidation, reorganisation or\n                  acquisition</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>any other person authorised by applicable law.</p>\n              </li>\n            </ul>\n          </div>\n          <p>Also, we may share information about your use of our website with our trusted advertising and analytics\n            partners through the use of cookies, web beacons, and similar storage technologies. Please refer to our\n            cookie\n            policy below for further information.</p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"tra-personal-info\">INTERNATIONAL TRANSFERS OF PERSONAL INFORMATION</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>A business that supports our website, products and services may be located outside of Malaysia (the country\n            where we are incorporated) and also outside of the country where you are located. This means that the\n            personal\n            information we collect may be transferred to, and stored in, a country outside of Malaysia and the country\n            where you are located.</p>\n          <p>If you are located in the European Economic Area (EEA), your personal information may be transferred\n            outside\n            of the EEA. Under the GDPR, the transfer of personal information to a country outside the EEA may take place\n            where the European Commission has decided that the country ensures an adequate level of protection. In the\n            absence of an adequacy decision, we may transfer personal information if other appropriate safeguards are in\n            place.</p>\n          <p>Where we transfer personal information outside the EEA, it will only be transferred to countries that have\n            been identified as providing adequate protection for EEA data, or to a third party where approved transfer\n            mechanisms are in place to protect your personal information (e.g. to organisations in the United States\n            under\n            the EU-U.S. Privacy Shield framework or by entering into the European Commission’s Standard Contractual\n            Clauses. For further information, please contact at <a class=\"theme-color\"\n              href=\"mailto: aaron@goquo.com\">aaron@goquo.com.</a></p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"pro-personal-info\">PROTECTING YOUR PERSONAL INFORMATION</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>As required by applicable law, we will take steps to keep your personal information safe from loss,\n            unauthorised activity, or other misuse. We implement appropriate technical and organisational measures to\n            ensure a level of security appropriate to the risks inherent in processing personal information.</p>\n          <p>You play an important role in keeping your personal information secure by maintaining the confidentiality\n            of\n            any password and accounts used in relation to our products and services. You should not disclose your\n            password\n            to third parties. Please notify us immediately if there is any unauthorised use of your account or any other\n            breach of security.</p>\n        </div>\n\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"acc-personal-info\">ACCESSING AND CORRECTING YOUR PERSONAL INFORMATION</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>Subject to certain grounds for refusal under applicable law, you have the right to access your personal\n            information that we hold and to request a correction to your personal information. Before you exercise this\n            right, we will need evidence to confirm that you are the individual to whom the personal information\n            relates.</p>\n          <p>Where you request a correction, if we think the correction is reasonable and we are reasonably able to\n            change your personal information, we will make the correction. In all other cases, we will take reasonable\n            steps to make a note of the personal information that was the subject of your correction request.</p>\n          <p>If you want to exercise either of the above rights, email us at [insert email address]. Your email should\n            provide evidence of who you are and set out the details of your request (e.g. the personal information to be\n            corrected and the correction that you are requesting).</p>\n          <p>Subject to applicable law, we may charge you our reasonable costs of providing to you copies of your\n            personal information or correcting that information. </p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"other-rights\">OTHER RIGHTS</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>In addition to the rights to access and correct your personal information, if you are based in the European\n            Union, you have the additional rights set out in the GDPR Additional Terms section of this privacy policy\n            below.</p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"int-use\">INTERNET USE</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p> While we take reasonable steps to maintain secure internet connections, if you provide us with personal\n            information over the internet, the provision of that information is at your own risk. </p>\n          <p>If you post your personal information on our website’s message board or chat room, you acknowledge and\n            agree\n            that the information you post is publicly available.</p>\n          <p>If you follow a link on our website to another website, the owner of that website will have its own privacy\n            policy relating to your personal information. We suggest you review that website’s privacy policy before you\n            provide personal information to that owner or website.</p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"ret-policy\">DATA RETENTION POLICY</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>The personal information that we collect and use will not be kept longer than necessary for the purposes\n            for\n            which it is collected, or for the duration required for compliance with applicable law, whichever is longer.\n          </p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"contact\">CONTACTING US</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>If you have any question about this privacy policy, or our privacy practices, or if you would like to\n            request\n            access to, or correction of, your personal information, you can contact us at <a class=\"theme-color\"\n              href=\"mailto: aaron@goquo.com\">aaron@goquo.com.</a></p>\n          <p>The name and contact details of our Data Protection Officer for the purposes of the GDPR are:</p>\n          <table class=\"table table-bordered\">\n            <tbody>\n              <tr>\n                <th scope=\"row\">Name</th>\n                <td>Srinivas</td>\n              </tr>\n              <tr>\n                <th scope=\"row\">Email address</th>\n                <td>srinivas@goquo.com</td>\n              </tr>\n              <tr>\n                <th scope=\"row\">Phone number</th>\n                <td colspan=\"2\">+601161565626</td>\n              </tr>\n            </tbody>\n          </table>\n        </div>\n        <h4 class=\"mt-4 main-color\"><b>GDPR ADDITIONAL TERMS</b></h4>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"basic-personal-info\">LAWFUL BASIS FOR PROCESSING PERSONAL INFORMATION</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>Our lawful basis for processing (as that term is defined in the GDPR) personal information that we collect,\n            use and disclose depends on the personal information collected and the context in which we collect it. </p>\n          <p>Generally, we collect personal information from you where we have your consent, where processing is\n            necessary\n            for the performance of a contract to which you are party or in order to take steps at your request prior to\n            entering into a contract, or where processing is necessary for the purposes of our legitimate interests\n            (except where such interests are overridden by your interests or fundamental rights and freedoms).</p>\n          <p>Where we process personal information based on your consent, you may withdraw your consent at any time.</p>\n          <p>Despite the above, we may process your personal information where such processing is necessary for\n            compliance\n            with applicable laws.</p>\n          <p>If you have any question about the legal basis on which we process personal information or need further\n            information, please contact us at <a class=\"theme-color\" href=\"mailto: aaron@goquo.com\">aaron@goquo.com.</a>\n          </p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\" id=\"under-gdpr\">YOUR RIGHTS UNDER THE GDPR</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>If you are located in the European Union, your rights in relation to your personal information include:</p>\n          <div class=\"s-features__list list-sm mb-30\">\n            <ul class=\"mt-4\">\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p><strong>right of access</strong> - if you ask us, we will confirm whether we are processing your\n                  personal information and provide you with a copy of that personal information</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p><strong>right to rectification</strong> - if the personal information we hold about you is inaccurate\n                  or incomplete, you have the right to have it rectified or completed. We will take reasonable steps to\n                  ensure inaccurate personal information is rectified. If we have shared your personal information with\n                  any third party, we will tell them about the rectification where possible</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p><strong>right to erasure</strong> – when your personal information is no longer needed for the\n                  purposes\n                  for which you provided it, we will delete it. You may request that we delete your personal information\n                  and we will do so if deletion does not contravene any applicable law. If we have shared your personal\n                  data with any third party, we will take reasonable steps to inform those third parties that they must\n                  delete your personal information</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p><strong>right to withdraw consent</strong> - if the basis of our processing of your personal\n                  information is consent, you can withdraw that consent at any time</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p><strong>right to restrict processing</strong> - you may request that we restrict or block the\n                  processing of your personal information in certain circumstances. If we have shared your personal\n                  information with any third party, we will tell them about this request where possible</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p><strong>right to object to processing</strong> - you may request that we stop processing your\n                  personal\n                  information at any time and we will do so to the extent required by the GDPR</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p><strong>rights related to automated decision-making, including profiling</strong> - you have the\n                  right\n                  to not be subject to a decision based solely on automated processing, including profiling, which\n                  produces legal effects concerning you or similarly significantly affects you, except where such\n                  automated decision-making is necessary for entering into, or the performance of, a contract with you,\n                  is\n                  authorised by applicable laws or is based on your explicit consent. We do not undertake automated\n                  individual decision-making.</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p><strong>right to data portability</strong> - you may obtain your personal information from us that\n                  you\n                  have consented to give us or that is necessary to perform a contract with you. We will provide this\n                  personal information in a commonly used, machine-readable and interoperable format to enable data\n                  portability to another data controller. Where technically feasible, and at your request, we will\n                  transmit your personal information directly to another data controller</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p><strong>the right to complain to a supervisory authority</strong> - you can report any concern you\n                  have\n                  about our privacy practices to your local data protection authority.</p>\n              </li>\n            </ul>\n          </div>\n          <p>Where personal information is processed for the purposes of direct marketing, you have the right to object\n            to\n            such processing, including profiling related to direct marketing.</p>\n          <p>If you would like to exercise any of your above rights, please contact us at aaron@goquo.com. If you are\n            not\n            satisfied by the way we deal with your query, you may refer your query to your local data protection\n            authority.</p>\n        </div>\n         <h4 class=\"wow fadeInUp mt-4 main-color\" data-wow-delay=\"0.2s\" id=\"cookie-policy\"><b>Cookie policy</b></h4>\n        <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\">INTRODUCTION</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>We use cookies on our website and as part of our related services, and receive information collected\n            through\n            cookies. This cookie policy explains how we use cookies and how you can opt out of cookies.</p>\n          <p> By continuing to use our website and related services, you indicate your agreement for us to use the\n            cookies\n            described below. </p>\n          <p>We use the term cookies in this cookie policy to mean cookies or similar technologies such as web beacons,\n            clear GIFs, and pixel tags.</p>\n        </div>\n\n        <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\">WHAT ARE COOKIES</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\" id>\n          <p>Cookies are text files containing small amounts of information which are downloaded to your browsing\n            device,\n            e.g. a computer or smartphone, when you visit a website. Cookies can be recognised by the website that\n            downloaded them, or by other websites that use the same cookies. This helps a website know if the browsing\n            device has visited that or other websites before.</p>\n          <p>Cookies can be used to collect information relating to your use of a website or your device, let you\n            navigate\n            between pages effectively, help to remember your preferences and generally improve your browsing experience.\n            Cookies can also help ensure advertising you see online is more relevant to you and your interests. </p>\n          <p>Cookies can be session or persistent cookies. Session cookies are temporary and only stay on your browser\n            until you stop browsing. Persistent cookies stay on your device until they expire or are deleted. </p>\n          <p>The cookies used on our website may be first party cookies (i.e. set by us) or third party cookies (i.e.\n            cookies set on our website by a person other than us). The third party companies that place cookies on our\n            website will have their own privacy policies.\n          </p>\n        </div>\n        <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\">WHAT TYPES OF COOKIES DO WE USE</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\" id>\n          <p>The types of cookies used by us, and most websites, can generally be categorised as follows.</p>\n          <p><strong>Strictly necessary cookies</strong></p>\n          <p>These cookies are essential for the full functionality of our website and related services. They enable you\n            to navigate around our website and services and use their features e.g. accessing secure areas and enabling\n            services that you have asked to receive. If you opt out of these cookies, you may not be able to access all\n            the functions of our website and some services that you have asked to receive.</p>\n          <p>These cookies do not track where else you have been on the internet and do not remember your preferences\n            beyond your current visit. These cookies are generally first party session cookies which will expire when\n            you close your browsing session. These cookies do not collect information that could be used for marketing\n            purposes.</p>\n          <p><strong>Functionality cookies</strong></p>\n          <p>These cookies allow a website to remember choices you make and provide enhanced, more personal features.\n            e.g. these cookies allow us to remember the settings you have applied to the website (such as font size,\n            preferences or colours), identify whether you are a returning website visitor and present you with a\n            personalised version of the website, or eliminate the need for you to re-enter your login details. The\n            information these cookies collect is generally anonymous and they do not track your browsing activity on\n            other websites. These cookies may be first or third party, session or persistent cookies.</p>\n          <p><strong>Performance cookies</strong></p>\n          <p>These cookies collect information about how you use a website, e.g. which pages are the most visited and if\n            you receive any error message from any page. This information helps us improve the way our website and\n            related services work and helps us manage the performance and design of the website and services. These\n            cookies do not gather information that identifies you. All of the information these cookies collect is\n            aggregated and anonymous. These cookies may be first or third party, session or persistent cookies.</p>\n          <p><strong>Targeting cookies</strong></p>\n          <p>Targeting cookies are used to present advertising that is relevant to you and your interests. These cookies\n            collect information about your browsing habits e.g. the pages you have visited and the links you have\n            followed across the internet. They may also be used to limit the number of times you see an advertisement\n            and help measure the effectiveness of advertising campaigns. These cookies will usually be persistent but\n            time-limited and may be placed on our website by third party service providers or advertising partners with\n            our permission.</p>\n          <p>We use targeting cookies to present interest-based advertising on our website and for retargeting. This is\n            a form of interest-based advertising that enables our advertising partners to build a profile of your\n            interests and show you advertising based on your browsing activity across the internet, including to allow\n            us to advertise to people who previously visited our website.</p>\n        </div>\n        <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\">GOOGLE COOKIES</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n          <p>We use Google Analytics to collect information about visitors to our website. Google Analytics collects\n            information related to your device, browser, IP address, network location, and website activities to measure\n            and report statistics about your interactions on our website. We use this information to help us manage the\n            performance and design of our website and to improve our website.</p>\n          <p>We use Google Analytics Advertising Features, including Remarketing with Analytics, Demographic and\n            Interests reporting in Analytics, Campaign Manager integration (formerly known as DoubleClick), Display &\n            Video 360 integration, Google Display Network (GDN) Impression Reporting and Segments. We also use Google\n            Ads. </p>\n          <p>For further information on how Google uses your personal information when you use our website and how to\n            opt out of Google’s use of cookies, see <a href=\"https://policies.google.com/\" class=\"a-link\"\n              target=\"_blank\">here</a>. In addition to the process described in this link, you can opt out using the\n            process described below.</p>\n          <h4 class=\"mt-4\">HOW TO CONTROL OR OPT OUT OF COOKIES AND TARGETED ADVERTISING</h4>\n          <p>You can control and/or delete cookies as you wish. You can delete all cookies that are already on your\n            computer and you can set most browsers to prevent them from being placed. However, if you do this, you may\n            have to manually adjust some preferences every time you visit our website and attempt use our services, you\n            may not be able to access certain parts of our website or services, and some functionalities may not work.\n          </p>\n          <p>You can find out more information about how to change your browser cookie settings at <a\n              href=\"http://www.aboutcookies.org.uk/\" class=\"a-link\" target=\"_blank\">www.aboutcookies.org.uk.</a></p>\n          <p>To learn more about how to control cookie settings through your browser:</p>\n          <div class=\"s-features__list list-sm mb-30\">\n            <ul class=\"mt-4\">\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>click <a href=\"https://support.mozilla.org/en-US/kb/private-browsing-use-firefox-without-history\"\n                    class=\"a-link\" target=\"_blank\">here</a> to learn more about the <b>Private Browsing</b> setting and\n                  managing cookie settings in Firefox</p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>click <a href=\"https://support.google.com/chrome/answer/95647?hl=en\" class=\"a-link\"\n                    target=\"_blank\">here</a> to learn more about <b>Incognito</b> and managing cookie settings in Chrome\n                </p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>click <a\n                    href=\"https://support.microsoft.com/en-us/help/17442/windows-internet-explorer-delete-manage-cookies\"\n                    target=\"_blank\" class=\"a-link\">here</a> to learn more about <b>InPrivate</b> and managing cookie\n                  settings in Internet Explorer\n                </p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>click <a href=\"https://support.apple.com/en-nz/guide/safari/browse-in-private-ibrw1069/mac\"\n                    class=\"a-link\" target=\"_blank\">here</a> to learn more about <b>Private Browsing</b> and managing\n                  cookie settings in Safari.</p>\n              </li>\n            </ul>\n          </div>\n          <p>You may opt out of targeted advertising at <a href=\"http://www.youronlinechoices.eu/\" class=\"a-link\"\n              target=\"_blank\">www.youronlinechoices.eu</a>. You can learn more about interest-based advertising and opt\n            out of interest-based advertising from participating online advertising companies at the following links.\n          </p>\n          <div class=\"s-features__list list-sm mb-30\">\n            <ul class=\"mt-4\">\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>Network Advertising Initiative (NAI) – <a href=\"http://optout.networkadvertising.org/\" class=\"a-link\"\n                    target=\"_blank\">optout.networkadvertising.org</a></p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>Digital Advertising Alliance (DAA) – <a href=\"http://optout.aboutads.info/\" class=\"a-link\"\n                    target=\"_blank\">optout.aboutads.info</a> </p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>Digital Advertising Alliance EU (EDAA) – <a href=\"http://www.youronlinechoices.com/\" class=\"a-link\"\n                    target=\"_blank\">www.youronlinechoices.com</a></p>\n              </li>\n              <li class=\"align-items-start\"><i class=\"icon icon icon-tick\"></i>\n                <p>DAA AppChoices page – <a href=\"http://www.aboutads.info/appchoices\" class=\"a-link\"\n                    target=\"_blank\">www.aboutads.info/appchoices</a></p>\n              </li>\n            </ul>\n          </div>\n          <p>Please note that opting out of interest-based advertising does not mean you will no longer be served\n            advertising. You will continue to receive generic ads.</p>\n        </div>\n        <h4 class=\"wow fadeInUp mt-4\" data-wow-delay=\"0.2s\">THIRD PARTY WEBSITE COOKIES</h4>\n        <div class=\"wow fadeInUp\" data-wow-delay=\"0.2s\" id>\n          <p>If you follow a link on our website to another website, the owner of that website will have its own\n            cookies. We suggest you review that website’s cookie policy before you visit that website.</p>\n        </div>\n      </div>\n      <div class=\"mt-3 d-none d-sm-block col-sm-4 sticky-nav\">\n        <ul class=\"sticky-nav-lists\">\n          <li><a pageScroll [pageScrollOffset]=\"30\" href=\"#introduction\">Introduction</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#change-policy\">Changes To This Policy</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#pp-apply\">When Does This Privacy Policy Apply</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#children\">Children</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#personal-info-col\">What Personal Information Do We\n              Collect</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#personal-info\">How We Use Your Personal Information</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#dis-personal-info\">Disclosing Your Personal Information</a>\n          </li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#tra-personal-info\">International Transfers Of Personal\n              Information</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#pro-personal-info\">Protecting Your Personal Information</a>\n          </li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#acc-personal-info\">Accessing And Correcting Your Personal\n              Information</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#other-rights\">Other Rights</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#int-use\">Internet Use</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#ret-policy\">Data Retention Policy</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#contact\">Contacting Us</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#basic-personal-info\">Lawful Basis For Processing Personal\n              Information</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#under-gdpr\">Your Rights Under The GDPR</a></li>\n          <li><a pageScroll [pageScrollOffset]=\"80\" href=\"#cookie-policy\">Cookie policy</a></li>\n        </ul>\n      </div>\n    </div>\n  </div>\n</section>\n<!-- Store-end -->\n");

