/* harmony default export */ __webpack_exports__["default"] = ("<!-- slider-area -->\n<section id=\"sub-header\" class=\"sub-header\" role=\"banner\"\n  [style.backgroundImage]=\"'url(../../assets/img/bg/map-bg.png)'\">\n  <div>\n    <h3 class=\"wow fadeInUp\" data-wow-delay=\"0.2s\">\n      <p>What is the maximum length of an SMS?</p>\n      <p>What is a concatenated message?</p>  \n    </h3>\n  </div>\n</section>\n<!-- slider-area-end -->\n\n<!-- About -->\n<section class=\"pt-40 pb-40\">\n  <div class=\"container\">\n\n    <div class=\"row flex-column-reverse flex-md-row\">\n      <div class=\"col-sm-8 col-md-9 mt-3\">\n        <h4 class=\"wow fadeInUp title-h4\" data-wow-delay=\"0.2s\" id=\"cty1\">SMS Length </h4>\n        <p class=\"wow fadeInUp\" data-wow-delay=\"0.4s\">SMS length depends on the type of characters you use. If you use tandard ACSII characters, an SMS has a limit of 160 characters.</p>\n        <p class=\"wow fadeInUp\" data-wow-delay=\"0.4s\">If you use unicode characters (e.g. for Thai, Arabic, Chinese and Japanese), an SMS has a limit of 70 characters.</p>\n        <p class=\"wow fadeInUp\" data-wow-delay=\"0.4s\">If you send or receive a message with more than 160 characters (or 70 unicode characters), one (1) message will be counted as two (2) SMS. </p>\n\n        <h4 class=\"wow fadeInUp title-h4\" data-wow-delay=\"0.2s\" id=\"cty1\">Concatenated messages </h4>\n        <p class=\"wow fadeInUp\" data-wow-delay=\"0.4s\">Every additional SMS after the first 160 characters (or 70 unicode characters) is referred to as a concatenated message part.</p>\n        <p class=\"wow fadeInUp\" data-wow-delay=\"0.4s\">The maximum number of concatenated message parts in a single text message is 20 parts.</p>\n        <p class=\"wow fadeInUp\" data-wow-delay=\"0.4s\">Additionally, do note that the maximum length per concatenated message part is slightly reduced due to the inclusion of concatenation headers:</p>\n        <div class=\"s-features__list wow fadeInLeft\" data-wow-delay=\"0.4s\">\n          <ul>\n            <li>\n              <i class=\"icon icon icon-tick\"></i>\n              <p>152 characters for ASCII</p>\n            </li>\n            <li>\n              <i class=\"icon icon icon-tick\"></i>\n              <p>66 characters for Unicode</p>\n            </li>\n          </ul>\n        </div>\n      </div>\n      <div class=\"mt-5 d-none d-sm-block col-sm-4 col-md-3 sticky-nav\">\n\n      </div>\n    </div>\n  </div>\n</section>\n<!-- Store-end -->\n");

